import React from 'react';
import logo from './logo.svg';
import './App.css';
import zutaten from './ZutatenEingabe/Liste.jsx'
import ReactDOM from 'react-dom';
import Button from '@material-ui/core/Button';
import Checkbox from '@material-ui/core/Checkbox';
import Uebersicht from '../src/Rezeptuebersicht/Uebersicht.js'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom"; 

export default function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">ZutatenEingabe</Link>
            </li>
            <li>
              <Link to="/Rezeptuebersicht">Rezeptübersicht</Link>
            </li>
            <li>
              <Link to="/Rezept">Rezept</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
           <Switch>
            <Route path="/Rezeptuebersicht" component={Uebersicht}>
              <Rezeptuebersicht />
            </Route>
            <Route path="/Rezept">
              <Rezept />
            </Route>
            <Route path="/">
              <ZutatenEingabe />
            </Route>
          </Switch>
        </div>
      </Router>
    );
  }

  function ZutatenEingabe() {
    return <h2> ZutatenEingabe</h2>;
  }

  function Rezeptuebersicht() {
    return <h2>Rezeptübersicht</h2>;
  }

  function Rezept() {
    return <h2>Rezept</h2>;
  }
